apm policy policy-item /Common/adminAuth_local_aPolicy_act_localdb_auth {
    agents {
        /Common/adminAuth_local_aPolicy_act_localdb_auth_ag {
            type aaa-localdb
        }
    }
    caption "LocalDB Auth"
    color 1
    item-type action
    rules {
        {
            caption Successful
            expression "expr {[mcget {session.localdb.last.result}] == 1}"
            next-item /Common/adminAuth_local_aPolicy_end_allow
        }
        {
            caption "Locked User Out"
            expression "expr {[mcget {session.localdb.last.result}] == 2}"
            next-item /Common/adminAuth_local_aPolicy_end_deny
        }
        {
            caption fallback
            next-item /Common/adminAuth_local_aPolicy_end_deny
        }
    }
}
apm policy policy-item /Common/adminAuth_local_aPolicy_act_logon_page {
    agents {
        /Common/adminAuth_local_aPolicy_act_logon_page_ag {
            type logon-page
        }
    }
    caption "Logon Page"
    color 1
    item-type action
    rules {
        {
            caption fallback
            next-item /Common/adminAuth_local_aPolicy_act_localdb_auth
        }
    }
}
apm policy policy-item /Common/adminAuth_local_aPolicy_end_allow {
    agents {
        /Common/adminAuth_local_aPolicy_end_allow_ag {
            type ending-allow
        }
    }
    caption Allow
    color 1
    item-type ending
}
apm policy policy-item /Common/adminAuth_local_aPolicy_end_deny {
    agents {
        /Common/adminAuth_local_aPolicy_end_deny_ag {
            type ending-deny
        }
    }
    caption Deny
    color 2
    item-type ending
}
apm policy policy-item /Common/adminAuth_local_aPolicy_ent {
    caption Start
    color 1
    rules {
        {
            caption fallback
            next-item /Common/adminAuth_local_aPolicy_act_logon_page
        }
    }
}
